import React, { useRef, useEffect } from "react";
import Astro from "./Astro";
import ChatMock from "./ChatMock";

export default function App() {
  const astroRef = useRef(null);
  const controlsRef = useRef({
    publish: () => {},
    undo: () => {},
    sparkIdea: () => {},
    bored: () => {},
    bigLoader: () => {},
    smallLoader: () => {},
    shrink: () => {},
    pulse: () => {},
    pulseThen: async () => {},
    idle: () => {},
    lookAt: () => {},
  });

  // Top-middle placement on start / resize
  useEffect(() => {
    const toTopMiddle = () => {
      const x = Math.round(window.innerWidth / 2);
      const y = 72; // adjust if needed
      astroRef.current?.moveTo(x, y);
    };
    requestAnimationFrame(toTopMiddle);
    window.addEventListener("resize", toTopMiddle);
    return () => window.removeEventListener("resize", toTopMiddle);
  }, []);

  const moveToRectTL = (rect) =>
    rect && astroRef.current?.moveTo(rect.left, rect.top);
  const moveToComposerTL = (rect) =>
    rect && astroRef.current?.moveTo(rect.left, rect.top);

  return (
    <div className="app">
      <Astro
        ref={astroRef}
        initialX={Math.round(window.innerWidth / 2)}
        initialY={72}
        zIndex={20000}
        onReady={(controls) => (controlsRef.current = controls)}
      />

      <div className="ui-root" data-ui-root>
        <header className="app-header">
          <div className="brand">
            <span className="dot" /> Astro Sandbox
          </div>
          <div className="controls">
            <button onClick={() => controlsRef.current.publish()}>
              Publish
            </button>
            <button onClick={() => controlsRef.current.undo()}>Undo</button>
            <button onClick={() => controlsRef.current.sparkIdea()}>
              Idea Spark
            </button>
            <button onClick={() => controlsRef.current.bored()}>Boredom</button>
            <button onClick={() => controlsRef.current.bigLoader()}>
              Big Loader
            </button>
            <button onClick={() => controlsRef.current.smallLoader()}>
              Small Loader
            </button>
            <button onClick={() => controlsRef.current.shrink()}>Shrink</button>
            <button onClick={() => controlsRef.current.pulse()}>Pulse</button>
            <button onClick={() => controlsRef.current.idle()}>Idle</button>
          </div>
        </header>

        <main className="chat-layout">
          <ChatMock
            // focus/typing → go down to composer
            onComposerActive={(composerRect) => moveToComposerTL(composerRect)}
            // after Send → go up to the assistant spot
            onAssistantSpot={(rect) => moveToRectTL(rect)}
            // run Pulse while "thinking"; resolve when flourish is done
            waitForPulse={() => controlsRef.current.pulseThen?.()}
            // after assistant message renders → go back down
            onAssistantDone={(composerRect) => moveToComposerTL(composerRect)}
            // (optional) keyword→state mapping
            onSend={(msg) => {
              const t = msg.toLowerCase();
              if (t.includes("publish")) controlsRef.current.publish();
              else if (t.includes("undo")) controlsRef.current.undo();
              else if (t.includes("idea")) controlsRef.current.sparkIdea();
              else if (t.includes("bore")) controlsRef.current.bored();
              else if (t.includes("big load")) controlsRef.current.bigLoader();
              else if (t.includes("load")) controlsRef.current.smallLoader();
              else controlsRef.current.shrink();
            }}
          />
        </main>
      </div>
    </div>
  );
}
